import React from "react";
import classes from "./listing.module.css";

const Listing = () => {
const sample = {
"land_id": 1494060,
"office_Address": "1459 Gonzales Union Suite 419",
"land_city": "Spokane",
"land_state": "WA",
"land_zip": 99208,
"Contact_no": "066-571-6597x803",
"Email": "vbyrd@example.net",
"land_review": "4.05",
"Id": 180279,
"Address": "15237 Marks Villages",
"City": "Spokane",
"State": "WA",
"Zip": 99260,
"Description": "Roomy bedrooms with plenty of closet space available now through the end of the school year!",
"no_of_rooms": 3,
"no_of_bathrooms": 1,
"monthly_rent": 2073,
"security_deposit": 310,
"landlord_Id": 1494060
}
  return (
    <div className={classes.container}>
      <div className={classes.left}>
        <img
          alt="ww"
          className={classes.mainImage}
          src="https://blogs.microsoft.com/wp-content/uploads/prod/sites/5/2022/01/AHI-Lead-1.jpg"
        ></img>
      </div>
      <div className={classes.right}>
        <h1 className={classes.description}> {description}</h1>
      </div>
    </div>
  );
};

export default Listing;
